# Gets time stamps for all User in the domain that have NOT logged in since after specified date
# Mod by Satish V on 2017-06-13
import-module activedirectory 
$domain = "vel.co.in" 
$DaysInactive = 30
$time = (Get-Date).Adddays(-($DaysInactive))
$date = Get-Date;
$createdtime = (Get-Date).Adddays(-(31))

#export list user data
Get-ADUser -Filter * -Properties Enabled, CanonicalName, Displayname, Givenname, Surname, EmployeeNumber, EmailAddress, Department, StreetAddress, Title, Location, country, office, DistinguishedName, Manager, whenCreated, LastLogonDate, LockedOut | select Enabled, CanonicalName, Displayname, GivenName, Surname, EmployeeNumber, EmailAddress, Department, Title, Location, country, office, DistinguishedName, Manager, whenCreated, LastLogonDate, LockedOut | Export-Csv -Path "E:\SCRIPT_OUTPUT\USER DATA\User_$((Get-Date).ToString('MM-dd-yyyy_hh-mm-ss')).csv"

#export never logged on ad user data
Get-ADUser -Filter {(lastlogontimestamp -notlike "*") -and (enabled -eq $true) -and (whencreated -lt $createdtime) -and (enabled -eq $true) -and (whencreated -lt $createdtime)} | Select Name,DistinguishedName | Export-Csv -path "E:\SCRIPT_OUTPUT\USER DATA\NeverLoggedOnUsers_$((Get-Date).ToString('MM-dd-yyyy_hh-mm-ss')).csv" -NoTypeInformation -Encoding UTF8
 
# Get all AD User with lastLogonTimestamp less than our time and set to enable
Get-ADUser -Filter {LastLogonTimeStamp -lt $time -and enabled -eq $true} -Properties LastLogonTimeStamp |

# Filters such as last login
Where-Object {$_.LastLogonDate -lt $date.AddDays(-30)}|
Where-Object {$_.Created -lt $date.AddDays(-30)}| 

# Output Name and lastLogonTimestamp into CSV
select-object Name,@{Name="Stamp"; Expression={[DateTime]::FromFileTime($_.lastLogonTimestamp)}} | Export-Csv -Path "E:\SCRIPT_OUTPUT\DISABLED USERS\Users_$((Get-Date).ToString('MM-dd-yyyy_hh-mm-ss')).csv"

