#OU you want to place disabled computers
$DestinationOU = "OU=DISABLED USERS,DC=vel,DC=co,DC=in"
$StaleUser = Get-ADUser -SearchBase $DestinationOU -Filter {LastLogonTimeStamp -lt $time} -Properties LastLogonTimeStamp
$StaleUser | Disable-ADAccount

$NeverLoggedOnInactiveUser = Get-ADUser -SearchBase $DestinationOU -Filter {(lastlogontimestamp -notlike "*") -and (enabled -eq $true) -and (whencreated -lt $createdtime)}
$NeverLoggedOnInactiveUser | Disable-ADAccount

$moveToOU = "OU=DISABLED USERS,DC=vel,DC=co,DC=in"

Search-ADAccount -AccountDisabled -UsersOnly |
Select Name,Distinguishedname |
Out-GridView -OutputMode Multiple |
foreach { 
 Move-ADObject -Identity $_.DistinguishedName -TargetPath $moveToOU -WhatIf
 }